// For BookMyShow Stream mini project

import React from 'react';
import ReactDOM from 'react-dom';
import Cards from './Streamcards';
import Sdata from './Sdata';


const favGener = "Action";

const FavG = () => {
	
if (favGener === "Action") {
		return (
            <Cards 
             movieimg={Sdata[1].movieimg} 
             movietitle={Sdata[1].movietitle}
             moviegenre={Sdata[1].moviegenre} 
             moviename={Sdata[1].moviename}
             movielink={Sdata[1].movielink} 
            />
           );
}
else {
	return (
            <Cards 
             movieimg={Sdata[3].movieimg} 
             movietitle={Sdata[3].movietitle}
             moviegenre={Sdata[3].moviegenre} 
             moviename={Sdata[3].moviename}
             movielink={Sdata[3].movielink} 
            />
           );
}

};

const App = () => (
  <>
  <h1 className="style_css">Top Streaming On BookMyShow In 2021</h1>
  {Sdata.map((val) => {
    return (
            <Cards movieimg={val.movieimg} 
             movietitle={val.movietitle}
             moviegenre={val.moviegenre} 
             moviename={val.moviename}
             movielink={val.movielink} 
            />
           );
        })}
   </>
);

export default App;
